import React from "react";
import { Switch, Route, Link } from "react-router-dom";
import "./App.css";
import Signin from "./pages/auth/login";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path="/" component={Signin} />
      </Switch>
    </div>
  );
}

export default App;
